import React from 'react';
import {useState} from 'react';

const Collapsible =()=>{
    const [open, setOPen] = useState(false);
    const toggle = () => {
        setOPen(!open);
      };
    return (
        <div>
        <button onClick={toggle}>toggle</button>
        {open && (
        <div className="toggle">
            <h4>toggle</h4>
        </div>
        )}
        </div>
    );
}
export default Collapsible;
